import React from "react";
import IInfos from "../../types";
import Item from "./Item";
import styles from './style.module.scss'
export default function Lista({names}: {names: IInfos[]}){
    return(
        <div className={styles.listWrapper}>
            <ul>
                {names.map((item) => {
                    
                return(     
                    <Item
                    
                    {...item}
                    />
                    )
                })}
            </ul>
        </div>

    )
}
